import React, {useState} from 'react'
function Register ()
{
    return(
        <div className="col-sm-6 offset-sm-3">
            <h1>Registro</h1>
            <input type="text" className="form-control" placeholder="Nome"></input><br/>
            <input type="text" className="form-control" placeholder="E-mail"></input><br/>
            <input type="text" className="form-control" placeholder="Senha"></input><br/>
            <button className="btn btn-primary">Registrar</button>
        </div>
    )
}

export default Register
